##########################################################################
### Information for reporting
##########################################################################

SCREENLOG:
  # enable or disable logging to the screen/console when mismatches or errors are found
  Enabled: No

FILELOG:
  # enable or disable logging to a file when mismatches or errors are found
  Enabled: No

SMTPLOG:
  # enable or disable logging by sending mail when mismatches or errors are found
  Enabled: Yes
  # smtp server info
  Server: smtp.home
  Port: 587
  TLS: No
  CA: No
  Login:
  Password:
  From: Scan-Network@engrie.home
  To: marc@engrie.home

SYSLOG:
  # enable or disable logging by sending syslog message when mismatches or errors are found
  Enabled: Yes
  # syslog server info
  Server: syslog.home
  Port: 514

##########################################################################
### Information for scanning
##########################################################################

PINGSCAN:
  # ping parameters
  # number of pings to send
  # Default 3
  Count: 5
  # length to the ping packet in bytes
  # Default 256
  Length: 64
  # timeout to wait for reply in milliseconds
  # Default 300
  Timeout: 300

ARPSCAN:
  # enable or disable discovery of MAC addresses using ARP
  # used to discover devices that do not respond to a ping
  # make sure Npcap is installed, if enabled
  # https://npcap.com/#download
  Enabled: Yes
  # ARP parameters
  # timeout to wait for reply in seconds
  # Default 2
  Timeout: 2

PORTSCAN:
  # port scan parameters
  # timeout for waiting the port to respond, in seconds
  # Default 1
  Timeout: 1
  # number of threads at one moment in time to be active
  # you might loose ports if you increase this number.
  # if you think you missed open ports, decrease this number
  # Default 20
  Threads: 20
  # enable or disable port scanning advisory
  Advisory: No
  
MDNSSCAN:
  # enable or disable full mDNS scanning
  Enabled: Yes
  # mDNS parameters
  # timeout, in seconds, to wait to catch all replies
  # + Recommended Listening Duration
  #   Minimum:    5 –  10 seconds — enough to catch some initial broadcasts.
  #   Typical:   30 –  60 seconds — gives time for most devices to announce themselves.
  #   Extended: 120 - 300 seconds — ideal if you want to catch intermittent or delayed service announcements.
  # + To know
  #   Devices don’t all announce at once. Some wait until they’re idle or triggered by network events.
  #   Some services (like printers or smart TVs) may only broadcast when actively used.
  #   If a device just joined the network, it may take a few seconds before it starts advertising.
  # Default 180
  Timeout: 210

NETSCAN:
  # enable or disable full network scanning
  Enabled: Yes
  # enable or disable port scanning for full ip scanning
  Portscan: Yes
  # port scanning info
  # Default 1
  Start: 1
  # Default 1024
  End: 1024
  # enable or disable adding a port description in .net file
  PortDesc: Yes

LISTSCAN:
  # enable or disable port scanning for the list file
  Enabled: Yes
  # enable or disable port scanning for full range
  Portscan: Yes
  # port scanning info
  # Default 1
  Start: 1
  # Default 1024
  End: 1024
  # enable or disable adding a port description
  PortDesc: Yes

MDNS:
  # list of known services to look for
  # a mDNS service exists of
  #   name = readable text
  #   service = the name mDNS uses to publish the service
  #   property flag which indicates if the service had properties
